                {
                    "name": "Ezinwa Okpoechi",
                    "email": "brainmaestro@outlook.com"
                }
            ],
            "description": "Easily manage git hooks in your composer config",
            "keywords": [
                "HOOK",
                "composer",
                "git"
            ],
